window.bookSummaryJSON = "<p>The final skull has been found. Now, all hell's breaking loose.</p> <p>For 2,000 years, the Triarii have protected us, influencing history from the Crusades to the discovery of America. Descending from the Roman Empire, they pervade every level of society and are now in a race with our own government to retrieve an ancient artifact thought to have been lost forever.</p> <p>Caught in the middle is archaeology professor James Acton, relentlessly hunted by the elite Delta Force, under orders to stop at nothing to possess what he has found, and the Triarii, equally determined to prevent the discovery from falling into the wrong hands.</p> <p>With his students and friends dying around him, Acton flees to find the one person who might be able to help him, but little does he know he may actually be racing directly into the hands of an organization he knows nothing about.<br> </p> <p>From <i>USA Today</i> and million copy best-selling author J. Robert Kennedy comes <i>The Protocol</i>, the first entry in an action-packed, globe-spanning series of thrillers certain to leave you breathless.<br> </p> <p>If you enjoy fast-paced adventures in the style of Dan Brown, Clive Cussler, and James Rollins, then youâ€™ll love this taut tale of archaeological suspense.<br> </p> <p>Get<i> The Protocol </i>now, and dig up a thriller 2,000 years in the making....<br> </p> <p>About the James Acton thrillers:<br> </p> <p>The James Acton Thrillers series and its spin-offs - the Special Agent Dylan Kane Thrillers and the Delta Force Unleashed Thrillers - have sold over one million copies. If you love nonstop action and intrigue with a healthy dose of humor, try James Acton today!</p>"; 
